INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 1, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, 62, 3.414, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 190805, -416.5, "カリン", 1000001, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 1, "ミッションをクリアして、\n報酬をゲットしましょう！", 2, 62, 3.099, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 190805, -416.5, "カリン", 1000002, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 1, "受け取ることができる\n報酬があるようです\n確認してみてください", 3, 63, 2.801, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 190805, -416.5, "カリン", 1000003, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, 1, "報酬がもらえますよ！\nチェックしてみてください", 4, 63, 0.0, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 190805, -416.5, "カリン", 1000004, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, 1, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 5, 64, 2.12, 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 190805, -363.0, "カリン", 1000005, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 1, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 6, 64, 1.68, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 190805, -363.0, "カリン", 1000006, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, 1, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 7, 64, 2.33, 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 190805, -363.0, "カリン", 1000007, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (3, 10201, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 101, 61, 5.18, 7, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 133701, -285.0, "ラビリスタ", 1020101, -6.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 10201, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 201, 61, 8.77, 2, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 133901, -285.0, "クリスティーナ", 1020102, -2.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (6, 10201, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 301, 61, 15.5, 1, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 133801, -285.0, "ネネカ", 1020103, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, 10202, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 101, 61, 9.061, 5, "2030/01/01 14:59:59", "2025/02/28 12:00:00", 134301, -285.0, "ランファ", 1020201, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 10202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 201, 61, 7.699, 2, "2030/01/01 14:59:59", "2025/02/28 12:00:00", 134401, -285.0, "チカ", 1020202, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 10203, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 101, 61, 8.595, 2, "2030/01/01 14:59:59", "2025/03/31 12:00:00", 134601, -285.0, "アオイ", 1020301, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 10203, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 201, 61, 7.758, 2, "2030/01/01 14:59:59", "2025/03/31 12:00:00", 134501, -285.0, "クローチェ", 1020302, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, 10204, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 101, 61, 7.0, 6, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 132302, -285.0, "ルイズマリー", 1020401, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 10204, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 201, 61, 7.904, 2, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 132402, -285.0, "イロハ", 1020402, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (4, 10204, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 301, 61, 8.487, 2, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 132502, -285.0, "ソノ", 1020403, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 10205, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 101, 61, 8.763, 2, "2030/01/01 14:59:59", "2025/05/31 12:00:00", 134901, -285.0, "カノン", 1020502, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 10205, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 201, 61, 6.417, 3, "2030/01/01 14:59:59", "2025/05/31 12:00:00", 134801, -285.0, "ツムギ", 1020503, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (3, 10206, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 101, 61, 10.335, 7, "2030/01/01 14:59:59", "2025/06/30 12:00:00", 135001, -285.0, "エリス", 1020601, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (2, 10206, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 201, 61, 6.281, 4, "2030/01/01 14:59:59", "2025/06/30 12:00:00", 135101, -285.0, "シェフィ", 1020602, 0.0);
INSERT INTO `v1_9ef4f7c620008b3da02c57219729918843b9b412532a9087c9eb8c7fe01d7b34` VALUES (1, 10206, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 301, 61, 12.244, 2, "2030/01/01 14:59:59", "2025/06/30 12:00:00", 135201, -285.0, "プレシア", 1020603, 0.0);
